export default {
  name: "ArrowBackIcon",
  props: {
    strokeColor: String,
    default: "#1C8FF8"
  },
  computed: {
    getStrokeColor() {
      if (this.strokeColor === 'red-primary') {
        return '#F53B57';
      }
      if (this.strokeColor === 'purple-primary') {
        return '#3A4276';
      }
      if (this.strokeColor === 'white') {
        return '#FFFFFF';
      }
      return '#BEBEBE';
    }
  }
};
